import React from "react";
import "./App.css";

function About() {
  return (
    <div className="about">
      <h1>About Page</h1>
      <p>This React Website is just for practice.</p>
      <p>This page is made by YASH JHAVERI!!</p>
      <p>Follow me on GitHub and LinkedIn</p>
    </div>
  );
}

export default About;
